import React from 'react'
import img1 from './images/img1.jpg';
import './Home.css';
function Home() {
    return (
        <>
            <div className="main">
                <div className='item1'> </div>
                <div className='item2'> 2
                    <img src={img1} alt="" /></div>
                <div className='item4'>   <div className='intro'>
                    <h1>Neha Shah</h1>
                    <p>Frontend Developer</p>
                </div></div>
            </div>


            {/* <div className='resume'>
                <h2>Resume</h2>
                <p>I study and teach why we, humans, behave the way we do and what our societies are based on. The keen observer will recognize this field as anthropology.

                    I can offer my services as a guest lecturer or a part-time professor at your higher education institution too. After all, there are few better sweeter things in life than sharing knowledge.
                </p>
            </div> */}

        </>
    )
}

export default Home;
